import React, { useState } from "react";
import "./Mobile.css";

import Battery from "../Battery/Battery";

const Mobile = () => {
    const [charge, setCharge] = useState(100);
    // const updateCharge = () => {
    //     setCharge(charge - 10);
    // };
    const setImg = (value) => {
        if (value >= 100) {
            return "/static/media/100.5a5f38ef23ebfba7b1d4.png";
        } else if (value < 100 && value >= 80) {
            return "data:image/png;base64,";
        } else if (value < 80 && value >= 40) {
            return "/static/media/50.5cd66afb3df4a1dc1b41.png";
        } else if (value < 40 && value > 0) {
            return "data:image/png;base64,";
        } else if (value <= 0) {
            return "/static/media/zero.fce1241414dac7ff7854.png";
        }
    };
    return (
        <div style={{ margin: "1rem" }}>
            <Battery name={setImg(charge)} value={charge}></Battery>

            <h2>{charge}</h2>
            <button
                onClick={
                    charge >= 0 ? () => setCharge(charge - 10) : setCharge(0)
                }
            >
                Battery Down
            </button>
            <button
                onClick={
                    charge <= 100
                        ? () => setCharge(charge + 10)
                        : setCharge(100)
                }
            >
                Battery Up
            </button>
        </div>
    );
};

export default Mobile;
